import styles from './Menu.module.css';

type MenuProps = { 
  activeItem: string, 
  menuItems:Array<object>,
};

const Searchbar: React.FC<MenuProps> = ({menuItems, activeItem}) => {
  return (
    <div className={styles.container}>
        <input/>
        <img/>
    </div>
  );
}

export default Searchbar;
